properties.approved_maps:
The eight United States Geological Survey (USGS) 1:24,000 scale topographic maps used to determine the boundary of the Tehachapi Mountains viticultural area are titled:
(1) Bear Mountain, CA, 2015;
(2) Keene, CA, 2015;
(3) Cummings Mountain, CA, 2015;
(4) Tehachapi North, CA, 2015;
(5) Tehachapi NE, CA, 2015;
(6) Monolith, CA, 2015;
(7) Tehachapi South, CA, 2015; and
(8) Tejon Ranch, CA, 2015.

